import styles from './Card.module.css'

export default function Card(props) {
   const {name,status, species, gender, origin, image, onClose} = props;
   return (
      <div className={styles.card}>
         <button onClick={onClose}>X</button>
         <h2>{name}</h2>
         <div>
         <h2>{status}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <h2>{origin}</h2>
         </div>
         <img src={image} alt="" />
      </div>
   );
}
